import "./MainContentStyles/MainContent.css";
import star from './MainContentStyles/star.png'
function MainContent() {
  return (
    <div className="mainContent">
      <div>
          <img src={star} width='10%' height='10%' alt=""/>
      </div>
      <div>Coin</div>
      <div></div>
      <div>Price</div>
      <div>1h</div>
      <div>24h</div>
      <div>7d</div>
      <div>24h Volume</div>
      <div>Mkt Cap</div>
      <div>Last 7 Days</div>
    </div>
  );
}

export default MainContent;
